import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './componentes/Home/Home'; // Adicione o componente Home se ele não estiver importado
import HomePortfolio from './componentes/Portfolio/HomePortfolio/HomePortfolio';
import Navbar from './components/Navbar';
import Servicos from "./componentes/Servicos/Servicos"; // Menu de navegação

function App() {
    return (
        <Router>
            <Navbar />
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/" element={<Servicos />} />
                <Route path="/portfolio" element={<HomePortfolio />} />
            </Routes>
        </Router>
    );
}

export default App;

